import { Button } from "@mui/material";
import axios from "axios";
import { useNavigate } from "react-router-dom";

axios.defaults.withCredentials = true;

const DeleteListingButton = (props) => {
  const navigate = useNavigate();

  console.log(props.listingType);

  const handleDelete = () => {
    const formatHash = {
      "Past Project": "past-projects",
      "Available Technology": "available-tech",
      "Opportunity": "opportunities"
    }
    const listingID = props.listingID;
    axios
      .delete(`http://localhost:5500/admin/listings/delete/${listingID}`)
      .then((response) => {
        if (response.data.auth === false) {
            navigate('/expired');
        } else if (response.data.result === "success") {
            console.log(`listingID ${listingID} successfully deleted`)
            navigate(`/admin#${formatHash[props.listingType]}`)
        } else {
            navigate('/error');
        }
      })
      .catch((err) => {});
  };

  return (
    <Button variant="contained" onClick={handleDelete}>
      Delete
    </Button>
  );
};

export default DeleteListingButton;
